const qr = require('qr-image');
const config = require('../../config/config');

const image = 'data:image/png;base64,';

const ticket = (datos) => {

    let activos = '';

    for (let i = 0; i < datos.length; i += 1) {
        const qrCadena = `${datos[i].codigo}|${datos[i].id_activo}|${datos[i].grupoc.id_grupoC}|${datos[i].auxiliar.id_auxiliar}|${datos[i].regional.nombre}`;

        const png = qr.imageSync(qrCadena, {
            size: 3,
            margin: 0,
        });

        const qrImg = png.toString('base64');
        if (i % 3 === 0) {
            activos += `
                </tr>
                <tr >
                    <td width="33%" class="ticket">
                        <table width="100%">
                            <tr>
                                <td class="imagen" width="25%" colspan="2">
                                    <img src="${image}" alt="" width="40px" height="20px">
                                </td>
                            </tr>
                            <tr>

                                <td class="qr" width="25%">
                                    <img src="data:image/png;base64,${qrImg}" alt="" width="30px" height="30px">
                                </td>

                                <td class="texto" width="50%">
                                    <p class="codigo">${datos[i].codigo}</p>
                                    <p class="texto2">${datos[i].nombre}</p>
                                    <p class="texto2">${datos[i].grupoc.nombre}</p>
                                    <p class="texto2">${datos[i].auxiliar.nombre}</p>
                                </td>
                            </tr>
                        </table>
                    </td>`; 
        } else {
            activos += `
                    <td width="33%" class="ticket">
                        <table width="100%">
                        <tr>
                        <td class="imagen" width="25%" colspan="2">
                            <img src="${image}" alt="" width="40px" height="20px">
                        </td>
                    </tr>
                    <tr>

                        <td class="qr" width="25%">
                            <img src="data:image/png;base64,${qrImg}" alt="" width="30px" height="30px">
                        </td>

                        <td class="texto" width="50%">
                            <p class="codigo">${datos[i].codigo}</p>
                            <p class="texto2">${datos[i].nombre}</p>
                            <p class="texto2">${datos[i].grupoc.nombre}</p>
                            <p class="texto2">${datos[i].auxiliar.nombre}</p>
                        </td>
                    </tr>
                        </table>
                    </td>`; 
        }
    }

  const mensaje = {
    html: `
    <!DOCTYPE html>
    <html lang="ess">
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>ticket</title>
            <style>
                .grid {
                    display: inline;
                    grid-template-columns: 100px 100px 100px;
                    grid-template-rows: 150px;
                    gap: 1em;
                }
                .grid div {
                    background: #E9E9E9;
                    border-radius: 20px;
                }
                .imagen {
                    text-align: center;
                    align-self: center;
                    padding: 0px;
                    margin: 0px;
                    margin-bottom: -15ppx
                }
                .imagen img {
                    padding: 0px;
                    margin: 0px;
                }
                .qr {
                    text-align: center;
                    align-self: center;
                }
                .texto {
                    text-align: center;
                    font-family: 'Courier New', Courier, monospace;
                    line-height : 5px;
                    align-self: center
                }
                .codigo {
                    font-size: 8px;
                    font-weight: bold;
                }
                .texto2 {
                    font-size: 6.5px;
                }
                .principal  tr  td {
                    border-radius: 10px;
                }
                .ticket {
                    border: 1px solid #000;
                }
            </style>
        </head>
        <body>
            <div class="grid">
                <table class="principal" width="100%">
                    ${activos}
                </table>
            </div>
        </body>
    </html>`,
  };
  return mensaje;
};

